import Frame from '../Frame/Frame';
import './Shirt.css'
import { Form } from 'react-bootstrap';
import axios from "axios"
class Shirt extends Component{
    constructor(props) {
        super(props);
        this.state = {
            data:[]
        };
      }
      componentDidMount() {
        axios.get('/shirt1')
        .then(res=>{
          console.log(res.data);
          this.setState({
            data:res.data
        });
        })
    }
    Show = (menus) => {
        var result = null;
        if (menus.length > 0) {
            result = menus.map((menu, index) =>{
                var link=menu.Link+"_to1"
                return(
                    <Frame className="flex-left" anh={link} ten={menu.Name} gia={menu.NewPrice} to={menu.Link}>  </Frame>
                )
            })
        }
        return result;
    }
    render(){
        return(
            <div className="shirt">
                <pre className="color-darkgray">HOME  <i class="fas fa-arrow-right color-black"></i> <b className="color-black"> SHIRT</b></pre>
                <p class="size-20"><b>ÁO</b></p>
                <div className=" flex-container ">
                    {/* <Frame className="flex-left"  anh="111" ten="Váy đầm trắng" gia="320.000" to="aaa"  ></Frame> */}
                    {/* {this.Show(this.state.data)} */}
                    <div>1</div>
                    <div>2</div>
                    <div>3</div>  
                    <div>4</div>
                    <div>5</div>
                    <div>6</div>  
                    <div>7</div>
                    <div>8</div>
                    <div>9</div>  
                    <div>10</div>
                    <div>11</div>
                    <div>12</div> 
                </div>
                
            </div>
        
        )
}}
export default Shirt
